import { useState } from "react";
import {
  Card,
  Icon,
  IconButton,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Tooltip,
} from "@mui/material";
import ShareIcon from "@mui/icons-material/Share";
import ArgonBox from "components/ArgonBox";
import ArgonTypography from "components/ArgonTypography";
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";

function FlaggedInstitutions() {
  const [institutions] = useState([
    { name: "Elim Kpachudu Hotel", type: "Hotel", reason: "License Expired", date: "2024-01-10" },
    { name: "Jossy Royal Hotel", type: "Hotel", reason: "Unpaid PAYE Tax", date: "2024-01-09" },
    { name: "Semshak Hotel", type: "Hotel", reason: "License Expired", date: "2024-01-08" },
    { name: "Fatima Private School", type: "School", reason: "Unpaid PAYE Tax", date: "2024-01-07" },
    { name: "Saints Academy", type: "School", reason: "License Expired", date: "2024-01-06" },
    { name: "Jinkai Hospital", type: "Hospital", reason: "License Expired", date: "2024-01-05" },
  ]);

  const handleShare = () => {
    // Implement sharing functionality
    console.log("Sharing with law enforcement...");
  };

  return (
    <DashboardLayout>
      <DashboardNavbar />
      <ArgonBox py={3}>
        <ArgonBox mb={3}>
          <Card>
            <ArgonBox display="flex" justifyContent="space-between" alignItems="center" p={3}>
              <ArgonBox>
                <ArgonTypography variant="h6" gutterBottom>
                  Flagged Institutions
                </ArgonTypography>
                <ArgonTypography variant="button" fontWeight="regular" color="text">
                  Institutions flagged for non-compliance
                </ArgonTypography>
              </ArgonBox>
              <Tooltip title="Share with law enforcement" placement="left">
                <IconButton onClick={handleShare} color="primary">
                  <ShareIcon />
                </IconButton>
              </Tooltip>
            </ArgonBox>
            <ArgonBox px={3} pb={3}>
              <TableContainer sx={{ 
                minWidth: 800,
                '& .MuiTableCell-root': {
                  padding: '16px',
                  whiteSpace: 'nowrap'
                }
              }}>
                <Table>
                  <colgroup>
                    <col style={{width:'35%'}}/>
                    <col style={{width:'15%'}}/>
                    <col style={{width:'25%'}}/>
                    <col style={{width:'15%'}}/>
                    <col style={{width:'10%'}}/>
                  </colgroup>
                  <TableHead>
                    <TableRow sx={{
                      backgroundColor: '#f8f9fa',
                      '& .MuiTableCell-root': {
                        color: '#344767',
                        fontWeight: 700,
                        borderBottom: '1px solid rgba(0,0,0,0.1)',
                      }
                    }}>
                      <TableCell sx={{ paddingLeft: '24px' }}>Name</TableCell>
                      <TableCell sx={{ paddingLeft: '24px' }}>Type</TableCell>
                      <TableCell sx={{ paddingLeft: '24px' }}>Reason</TableCell>
                      <TableCell sx={{ paddingLeft: '24px' }}>Date Flagged</TableCell>
                      <TableCell sx={{ textAlign: 'center' }}>Actions</TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {institutions.map((institution) => (
                      <TableRow 
                        key={institution.name}
                        sx={{
                          '&:hover': {
                            backgroundColor: 'rgba(0,0,0,0.04)'
                          },
                          '& .MuiTableCell-root': {
                            borderBottom: '1px solid rgba(0,0,0,0.06)',
                          }
                        }}
                      >
                        <TableCell sx={{ paddingLeft: '24px' }}>{institution.name}</TableCell>
                        <TableCell sx={{ paddingLeft: '24px' }}>{institution.type}</TableCell>
                        <TableCell sx={{ paddingLeft: '24px' }}>{institution.reason}</TableCell>
                        <TableCell sx={{ paddingLeft: '24px' }}>{institution.date}</TableCell>
                        <TableCell sx={{ textAlign: 'center' }}>
                          <IconButton size="small" color="info">
                            <Icon>visibility</Icon>
                          </IconButton>
                        </TableCell>
                      </TableRow>
                    ))}
                  </TableBody>
                </Table>
              </TableContainer>
            </ArgonBox>
          </Card>
        </ArgonBox>
      </ArgonBox>
    </DashboardLayout>
  );
}

export default FlaggedInstitutions;
